import styled from "styled-components";
import { useQuery } from "react-query";
import { areaTripIntro } from "../apis/api";

const TourItems = styled.div`
    display: flex;
    flex-wrap: wrap; 
    justify-content: space-evenly;
    margin-top: 5vh;
    gap: 10px;
    font-family: "kcc";
`;
interface Idata {
    // [key: number]: any,
    addr1: string,
    addr2: string,
    areacode: number,
    booktour: string,
    cat1: string,
    cat2: string,
    cat3: string,
    contentid: number,
    contenttypeid: number,
    createdtime: number,
    firstimage: string,
    firstimage2: string,
    mapx: number,
    mapy: number,
    mlevel: number,
    modifiedtime: number,
    readcount: number,
    sigungucode: number,
    tel: string,
    title: string,
    zipcode: number
}

interface Inum {
    contenttypeid?: number,
    contentId: number
}

interface Icont {
    contentId: string;
}

function AreaTourIntro(props: Inum) {
    const { isLoading, data: areaIntroData } = useQuery<Idata[]>(
        ["areaInfoData"],
        async () => {
            const areadata = await areaTripIntro(2901530, 39)
            // console.log("쿼리요청됨")
            return areadata.response.body.items.item
        },
    );
    console.log(isLoading, areaIntroData, "쿼리요청")
    return (
        <TourItems></TourItems>
    );
}

export default AreaTourIntro;
